/* eslint-disable */

// 仪表盘配置生成器
export default function gaugeOption(config, fileDataMap, xData, yDataArr, selectedChartType, seriesData, customOption = {}) {
    console.log('[gaugeOption] seriesData:', seriesData);
    return {
        tooltip: {
            formatter: '{a} <br/>{b} : {c}%'
        },
        series: [
            {
                name: 'Pressure',
                type: 'gauge',
                detail: {
                    formatter: '{value}'
                },
                data: seriesData
            }
        ]
    };
};
